(18, '62EDA9ACB142D7806156', 174, 'write all kind of acadamic assingments to pass the semester', 'write-all-kind-of-acadamic-assingments-to-pass-the-semester-62EDA9ACB142D7806156', '<p>Hello, my name is Abdullah Mehmood, and I\'ve been writing assignments professionally for three years.</p><p><br></p><p>I\'ll do any kind of academic assignment with study and APA-style formatting.</p><p><br></p><p>I know how to write assignments thanks to Chat GPT.</p><p><br></p><p>I\'ll give you all the work that has less than 10% Similarity index and 5% AI on Turnitin.</p><p><br></p>', '1000', 2, 10, 84, 329, 330, 331, 'pending', 2, 3, 0, 0, '0', 0, 0, 0, NULL, NULL, NULL, '2023-08-08 15:42:18', '2023-08-09 08:15:01'),
