(69, 28, 'Do you check for plagiarism?', 'No'),
(70, 28, 'Do you follow styleguide?', 'Yes, I follow the style guide prescribed by your university.  '),
(71, 28, 'Do you charge per page?', 'No, I charge per hour.');
