(1, '100605D5B16349014048', 'Terms and Conditions', 'terms-and-conditions', '<h4><strong>1.Overview</strong></h4><p>By accessing the website, you agree to the following terms with SkillMonde.</p><p>We may amend this user agreement and any linked information from time to time by posting amended terms on the website, without notice to you.</p><p>The Website is an online venue where Users buy and sell Seller Services. Buyers/Client and Sellers/ Freelancers must register for an Account in order to buy or sell Services. The Website enables Users to work together online to complete and pay for Projects, buy and sell services that we provide. We are not a party to any contractual agreements between Buyer and Seller in the online venue, we merely facilitate connections between the parties and we cannot be held responsible for the quality of work delivered by Seller.</p><p>We may, from time to time, and without notice, change or add to the Website or the information, products or services described in it. However, we do not undertake to keep the Website updated. We are not liable to you or anyone else if any error occurs in the information on the Website or if that information is not current.&nbsp;</p><p><strong>2. Scope</strong></p><p>You must read the whole User Agreement, the Website policies, and all related information before using the Website.</p><p>You must read and accept all of the terms in, and linked to, this User Agreement, the Code of Conduct, the SkillMonde Privacy Policy and other Website policies. You agree that this User Agreement will be in effect each time you use the Website or any of the tools we provide to interact with the Website by accepting it when you enter our website. We may present you with additional or different terms when you utilise certain Websites\' services.</p><p><strong>3. Eligibility</strong></p><p>You will not use the website in the following instances:</p><ol><li>Are not able to enter into a legally binding contract;</li><li>Are under the age of 18;</li><li>Are suspended from utilizing the site;</li><li>Do not hold a substantial or a valid Email address.</li></ol><p>All free user accounts are associated with individuals. Login credentials ought not to be imparted by clients to any other person. The individual associated with the respective account will be considered accountable for all moves made by the account without limitations upon it. Subject to you local laws, a person over 18 years can use an adults account with the permission of the account holder.&nbsp;</p><p>Clients recognize and concur that where a business name or organization name is related with their Record, this Client Understanding is an agreement with the Client as an individual (not the business or organization) and Clients remain exclusively answerable for activity of any kind embraced in regard of their Record. An organization, company, trust, organization or other non-individual corporate substance might be a Client subject to a qualified corporate record which pays corporate memberships. We may, at our outright circumspection, decline to enrol any individual or substance as a Client. You can\'t move or appoint any privileges or commitments you have under this arrangement &nbsp;to anyone without our prior written consent .</p><p><strong>4. Using SkillMonde</strong></p><p>While utilizing or accessing the site, you wont endeavour to or in any case do any of the accompanying:-</p><ol><li>post content or items in inappropriate categories or areas on our Websites and services;</li><li>infringe any laws, third party rights or our policies; &nbsp;</li><li>fail to deliver payment for services delivered to you;</li><li>fail to deliver seller services purchased from you;</li><li>avoid or control our fee structure, the charging system or expenses owed to the Seller;</li><li>post false, inaccurate, misleading, deceptive, defamatory or offensive content (including personal information);</li><li>take any action that may undermine the feedback or reputation systems (such as displaying, importing or exporting feedback information or using it for purposes unrelated to the Website);</li><li>transfer your SkillMonde account (including feedback) and Username to another party without our consent,</li><li>distribute or post spam, unsolicited, or bulk electronic communications, chain letters, or pyramid schemes;</li><li>distribute viruses or any other technologies that may harm SkillMonde, the Website, or the interests or property of SkillMonde users (including their intellectual property rights, privacy and publicity rights) or is unlawful, threatening, abusive, defamatory, invasive of privacy, vulgar, obscene, profane or which may harass or cause distress or inconvenience to, or incite hatred of, any person;</li><li>attempt to modify, translate, adapt, edit, decompile, disassemble, or reverse engineer any software programs used by us in connection with the Website;</li><li>copy, modify or distribute rights or content from the Website or SkillMonde copyrights and trademarks;</li><li>harvest or otherwise collect information about users, including email addresses, without their consent;</li></ol><p><strong>5. Fees and services</strong></p><p>You will be liable to pay all the fees and professional charges as per our fees schedule along with the incidental charges as and when required subject to our Payment mechanism, Fees and Refund Policy. Currently, we support INR as base currency for all the transactions in the platform.</p><p><strong>6. Taxes</strong></p><p>You will be liable to pay all the taxes at the time of availing the service as per the applicable rates and all the conditions will be applicable as per the existing provisions of the law prevailing at that present time.</p><p><strong>7. SkillMondes Proprietary Rights</strong></p><p>As between you and SkillMonde, the Websites is owned and/or provided by us. The names, logos, trademarks, trade dress, arrangements, visual interfaces, graphics, design, compilation, information, data, computer code (including source code or object code), products, software, services, and all other elements of the Websites (<strong>Materials</strong>) that we provide are protected by intellectual property and other laws. All Materials included in the Websites are the property of SkillMonde or its third-party licensors. You may only use the Websites and Services as expressly authorized by us and as set forth in this User Agreement. You shall abide by and maintain all intellectual property notices, information, and restrictions contained in the Websites and Services. We reserve all rights to the Websites and Services not granted expressly in this User Agreement.</p><p>If you choose to provide input and suggestions regarding problems with or proposed modifications or improvements to the Websites and Services (<strong>Feedback</strong>) then you hereby grant to us an unrestricted, perpetual, irrevocable, non-exclusive, fully-paid, royalty-free right to exploit the Feedback in any manner and for any purpose, including to improve the Websites and Services and create other products and services.&nbsp;</p><p>You grant us permission to include your name, logos, and trademarks in our promotional and marketing materials and communications.</p><p>Subject to your complete and ongoing compliance with this User Agreement and our rights therein, SkillMonde grants you a limited, non-exclusive, non-transferable, non-sublicensable, revocable license to access and use the Websites and/or Services as described in and subject to this User Agreement.</p><p><strong>8. Intellectual Property Rights in Deliverables</strong></p><p>Upon full payment of sums due to the seller, the intellectual property in the deliverables, including the source code to the extent applicable, (except the Pre-Existing Materials and Third Party Materials), shall belong to the Buyer.&nbsp; The Seller hereby grants to the Buyer, a non-exclusive, non-transferable, license to use the Sell