 to make any sort of complaint about the suspension or termination of your Account.</p><p><strong>13. Dispute With Us</strong></p><p>If a dispute arises between you and SkillMonde, our goal is to address your concerns immediately and, if we are unable to do so to your satisfaction, to provide you with a means of resolving the dispute quickly, we strongly encourage you to first contact us directly to seek a resolution by using our customer support or emailing us at___info@skillmonde.com________</p><p>For any claim, SkillMonde may elect to resolve the dispute in a cost effective manner through binding non-appearance based arbitration. If SkillMonde elects arbitration, such arbitration will be initiated through an established Alternative Dispute Resolution (ADR) provider, which is to be selected by you from a panel of ADR providers that SkillMonde will provide to you. The ADR provider and the parties must comply with the following rules: a) the arbitration shall be conducted by telephone, online and/or be solely based on written submissions, the specific manner shall be chosen by the party initiating the arbitration; b) the arbitration shall not involve any personal appearance by the parties or witnesses unless otherwise mutually agreed by the parties; and c) any judgment on the award rendered by the arbitrator may be entered in any court of competent jurisdiction.</p><p>All claims you bring against SkillMonde must be resolved in accordance with the terms of this Agreement. All claims filed or brought contrary to this Agreement shall be considered improperly filed and a breach of this Agreement. Should you file a claim contrary to the terms of this Agreement, SkillMonde may recover its legal fees and costs (including in-house lawyers and paralegals), provided that SkillMonde has notified you in writing of the improperly filed claim, and you have failed to promptly withdraw the claim. You agree that you will not pursue any claims arising under this User Agreement on a c