s Agreement. We urge you to use authorised mediation to try and settle problems (such as online dispute resolution processes). You and SkillMonde irrevocably submit to the non-exclusive jurisdiction of the Indian courts if a dispute cannot be settled.</p><p><strong>32. Force Majeure</strong></p><p>In no event shall Neither Party be responsible or liable for any failure or delay in the performance of its obligations under this User Agreement, arising out of or caused by, directly or indirectly, forces beyond its control, including, without limitation, strikes, work stoppages, accidents, acts of war or terrorism, civil or military disturbances, nuclear or natural catastrophes or acts of God, and interruptions, loss or malfunctions of utilities, communications or computer (software and hardware) services, epidemic, pandemic order, regulation, or restriction imposed by governmental, military or lawfully established civilian authorities, or by making of repairs necessitated by an emergency circumstance not limited to those listed above upon the property or equipment of the party or property or equipment of others which is deemed under the operational control of the party (Force Majeure Events);&nbsp;</p><p>Any Party claiming a Force Majeure event shall use reasonable diligence to remove the condition that prevents performance and shall not be entitled to suspend performance of its obligations in any greater scope or for any longer duration than is required by the Force Majeure event. Each Party shall use its best efforts to mitigate the effects of such Force Majeure event, remedy its inability to perform, and resume full performance of its obligations hereunder. A Party suffering a Force Majeure event (Affected Party) shall notify the other Party (Non-Affected Party) in writing (Notice of Force Majeure Event) as soon as reasonably practicable specifying the cause of the event, the scope of commitments under the Agreement affected by the event, and a good faith estimate of the time required to restore full performance. Except for those commitments identified in the Notice of Force Majeure Event, the Affected Party shall not be relieved of its responsibility to fully perform as to all other commitments in the Agreement. If the Force Majeure event continues for a period of more than 90 days from the date of the Notice of Force Majeure Event, the Non-Affected Party shall be entitled, at its sole discretion, to terminate the &nbsp;project with the affected Party.</p><p><strong>33. Severability</strong></p><p>The sections of this User Agreement are separate from one another, so if any of them are found to be unlawful or unenforceable, the remaining provisions will still be enforceable. In the event that we sell or otherwise transfer any or all of our assets, we may at any time assign this Agreement to a related entity or, without your permission, to a third party. You will continue to be obligated by this User Agreement even in the case of a sale or transfer.</p><p><strong>34. Interpretation</strong></p><p>Only for convenience, and in no way defining, limiting, construing, or describing the scope or extent of such section, headings are provided.</p><p><strong>35. No Waiver</strong></p><p>We may nevertheless take action in response to later or similar breaches even if we choose not to in response to an expected or actual breach by you or others. This clause does not limit or exclude your liability for fraud or false misrepresentation.</p><p><strong>36. Communications</strong></p><p>You agree to receive communications from us regarding the Website and Services, including notifications and information, electronically. You can revoke your consent at any time, but doing so can result in us suspending or closing your account.</p><p><strong>37. Abusing SkillMonde</strong></p><p>To the fullest extent permitted,&nbsp; SkillMonde reserves the right to impose restrictions on, suspend, or terminate our service(s) and or user account(s), to restrict or prohibit access to our service(s), to delete any content, and to take any and all technological or legal actions to prohibit users.</p><p>Without restricting the justifications for the aforementioned actions, actions that could trigger this reaction include:</p><p>1. Using our services for any illegal or dishonest intent</p><p>2. Posing risks of legal trouble or upsetting other users</p><p>3. violating another person\'s intellectual property rights</p><p>4. failing to follow any of our policies in text or spirit</p><p>5. Mistreatment of any employees, including offensive or unreasonable communications</p><p>7. Any effort to exploit the SkillMonde &nbsp;platform or services in a distasteful manner.</p><p><strong>38. Feedback</strong></p><p>Please get in touch with us through our customer care website or by contacting us at___________info@skillmonde.com____ if you have any inquiries about this User Agreement or if you wish to report violations of this User Agreement.</p><p>Please get in touch with us through our customer care website or by contacting us at___________info@skillmonde.com____ if you have any inquiries about this User Agreement or if you wish to report violations of this User Agreement.</p>', 0, NULL, '2', '2023-02-27 05:42:12', '2023-03-28 15:10:46');
INSERT INTO `pages` (`id`, `uid`, `title`, `slug`, `content`, `is_link`, `link`, `column`, `created_at`, `updated_at`) VALUES
(2, '3858B90352EE825E494F', 'Privacy Policy', 'privacy-policy', '<p><strong>PRIVACY POLICY</strong></p><p>The Terms and Conditions (\"Terms and Conditions\"), which are posted on the Website, and this privacy statement (\"Privacy Policy\") must be accepted in order for visitors to this website (hereafter referred to as \"you,\" \"your,\" or \"user\") to use any services provided by the Platform. The Information Technology Act of 2000, the Information Technology (Amendment) Act of 2008 ( Indian Act), and the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules of 2011 have all been complied with in the creation and publication of this privacy statement.</p><p>You, as a Website user, and we, as the Website\'s owner, are bound by the terms of this Privacy Policy. You must be at least 18 years old and a natural person. You declare to have read, comprehended, and agreed to be governed by this Privacy Statement. You are not permitted to use or access this Website if you disagree with any clause in this Privacy Policy or the Terms and Conditions.</p><p><strong>Introduction</strong></p><p>Your privacy is important to Us, and we want you to be aware of how we gather, utilise, and share information about you.&nbsp;</p><p>When it comes to protecting and managing any personally identifiable information (or \"Personal Information\") you share with us, we are dedicated to upholding the privacy of its users. Any information that can be used to identify a person, such as a first and last name, home or other physical address, email address, or other kind of contact information, whether at work or at home, is referred to as \"Personal Information.\"</p><p><strong>Exclusions</strong></p><p><i><strong>This policy does not apply to any information you may choose to give to websites we promote on behalf of third parties or to social media platforms where we have a profile. The privacy policies for those websites will apply to these.</strong></i></p><p><strong>Consent to use Personal Information</strong></p><p>By providing us with your Personal Information you expressly consent to us processing your Personal Information in accordance with the terms of this Privacy Policy.</p><p><strong>Information Collected by us</strong></p><p>When you use our services or Platform or engage in other interactions with us throughout our partnership, we may gather your personal information. Your Personal Information may also be obtained by us and our service providers, or information that is made publicly available. We gather Personal Information that is pertinent and unavoidably required in order to deliver the services you have requested and to continuously enhance the Platform.</p><p>Personal and Sensitive Personal Information collected includes but is not limited to:</p><ul><li>First name, last name, email address, date of birth, age, gender, phone number, and other demographic information;</li><li>employment information and preferences like your past and present work experience and qualifications;</li><li>KYC-related information;</li><li>Date and time of your visit on our Website along with the navigation details such as webpages visited and time spent on each webpage, and the details of the referring site;</li><li>For processing payments for the services rendered by you via the Website, we would require your banking details, such as name, address, email id, PAN card details and financial information that corresponds to your bank. including but not limited to, bank name, branch, account number, IFSC code etc;</li><li>Account details: these include your username and password and preferred account settings such as the language and time zone etc;</li></ul><p>Information may be collected at various stages of your usage of the Platform, including but not limited to:</p><ul><li>visiting the Platform</li><li>registering on the Platform or any other relationship that may be governed by terms and conditions listed on the Platform</li><li>interacting or attempting to interact with Us.</li><li>accessing links, e-mails, chat conversations, feedbacks, notifications sent or owned by Platform and if you opt to participate in our occasional surveys.</li><li>while applying for career opportunities with Us.</li><li>Work Portfolio and its information shared on platform</li></ul><p><strong>Usage of Information by Us</strong></p><p>We use the information we collect about you for the following purposes or in the following manner:</p><ul><li>registering or creating your account, confirming your identity, and granting appropriate access privileges;&nbsp;</li><li>enabling management of deliverables/tasks;&nbsp;</li><li>conducting the KYC compliance process in accordance with legal requirements;&nbsp;</li><li>generating and submitting invoices for services rendered and/or delivered;&nbsp;</li><li>processing payment of fees on your behalf and per your instructions;&nbsp;</li><li>communicating with you regarding transactions, legal requirements, and other matters;</li><li>By analysing user behaviour, we can improve your user experience in a variety of processes, including application submission and service availability;&nbsp;</li><li>periodically review and tweak our services to make them safer and simpler for you;&nbsp;</li><li>carry checks, screenings or due diligence checks as lawfully required by us; detect and protect us against error, fraud, money laundering and other criminal activity; enforce our terms and conditions;</li><li>enable Clients to contact you for goods and services you\'ve requested or accessed through our Platform;&nbsp;</li><li>market and offer our / our Clients products and services to you using various communication modes such as via email, tele-calling, SMS(es), etc.;</li></ul><p>Although we may sometimes handle your Personal Information for other legitimate business purposes, we make sure to take the necessary precautions to limit processing as much as possible to avoid privacy invasion.</p><p><strong>Security of your personal information</strong></p><p>Your personal information is stored on secure servers. By giving us your personal information, you give us permission to send such information to our secure servers and store it there. We take every care to prevent unauthorised, use, or disclosure of all of your personal information. The privacy of your Personal Information, however, cannot be guaranteed because the Internet is not a secure medium.</p><p>In addition to precautions taken at our end, you are suggested to do the following:</p><p> Each time you want to access your account or conduct a transaction on the Website, you must enter your username and password.</p><p> Be sure to use distinct numbers, letters, and special characters when selecting your password. Never divulge your login information to anyone.</p><p>Please contact our customer support (info@skillmonde.com) team&nbsp;if you suspect that your login or password has been compromised. Also, be sure to change your password by accessing the user settings area of the website.</p><p><strong>Sharing of Information</strong></p><p>In cases where sharing Personal Information is necessary to fulfil a contractual obligation, we will only do so with your permission. We might disclose your information without informing you to the following third parties as required by applicable law or as necessary to provide you with the requested Services:</p><p> Consultants (such as auditors and our authorised service providers) on a \"need to know\" basis under a non-disclosure agreement;&nbsp;</p><p> Governmental authorities, where permitted or required by applicable law.</p><p><strong>Retention of Information</strong></p><p>We store personal data within India and keep it there as long as necessary to fulfil the purposes for which it was gathered, in compliance with applicable laws. Nevertheless, we reserve the right to hold onto your personal information if we think it could be important to thwart fraud or other abuse in the future, if doing so is mandated by law, such as when a legal or regulatory procedure is pending or when we get a directive to that effect, or if we have other good reasons to do so.</p><p>When the Personal Information\'s retention period is up, it will be removed in accordance with any relevant legislation.</p><p><strong>Suitable Security Procedures</strong></p><p>To protect your information, we have implemented both technical and physical security precautions. Your personal information is kept behind protected networks and is only available by a select group of authorised users with the necessary access privileges; additionally, these users are obligated to maintain the information\'s confidentiality. Whenever appropriate, Personal Information is encrypted at-rest, and we use Secure Socket Layer to protect data in transit (SSL technology). We are aware that no security system is impenetrable, even how effective ours are. As a result, we conduct internal checks as part of our reasonable security protocols to ensure that the proper information security measures are in place for both the data that is in motion and the data that is at rest within our network and servers, respectively.</p><p><strong>Accessing and updating Personal Information</strong></p><p>By contacting us using the details listed in the \"Contact Us\" section of this Policy, you can request access to and a review of the Personal Information you shared with us. To verify verification and validate your identity, we might need to ask you for additional details. This is a security step to ensure that Personal Information is not altered or disclosed to someone who has no right to receive it. If you require any additional details on the services you are using, we kindly ask that you read the Terms of Use, which are available on the Platform. For seeking any further information on the same, you can write to us at the details mentioned in the Contact Us section of this Policy.</p><p>&nbsp;</p><p>Data Retention&nbsp;</p><p>As an India-based freelancer marketplace platform, we take data protection and privacy seriously. We collect data from users such as personal information and transactional data. To ensure that we comply with data protection laws and regulations, we have implemented a data retention policy.</p><p>&nbsp;</p><p>Our policy states that data will be retained for 365 days, after which it will be reviewed. During this period, users can request the deletion of their data. We believe this retention period is reasonable and necessary for us to provide efficient services to our users.</p><p>&nbsp;</p><p>To ensure the security of the data we collect, we perform weekly backups of our data, both online and offline. Additionally, we have installed SSL to provide a secure connection between our platform and users.</p><p>&nbsp;</p><p>As an India-based company, we follow the laws of our land to ensure compliance with relevant data protection laws and regulations. We understand the importance of protecting user data and will continue to review and update our data retention policy to ensure it aligns with the best practices of the industry.</p><p>&nbsp;</p><p><strong>Changes to the Privacy policy</strong></p><p>We reserve the right to amend, change or delete the policy and features at any time.</p><p><strong>Contact Us</strong></p><p>In case you have any questions or concerns regarding the processing of your Personal Information or this Privacy Policy you may write to us at ____________________info@skillmonde.com____. We are committed to answer your questions within the reasonable time limit.&nbsp;</p><p>&nbsp;</p>', 0, NULL, '2', '2023-02-27 05:43:38', '2023-03-09 14:02:00');
INSERT INTO `pages` (`id`, `uid`, `title`, `slug`, `content`, `is_link`, `link`, `column`, `created_at`, `updated_at`) VALUES
(3, '5D3B8356612675888D16', 'Refund Policy', 'refund-policy', '<h2 class=\"ql-align-center\" style=\"text-align:center;\"><strong>SkillMonde.com  Freelancing Marketplace</strong></h2><p>&nbsp;</p><p class=\"MsoNormal\" style=\"text-align:justify;\"><span lang=\"EN-IN\">For the Service based SkillMonde MarketPlace Platform:</span></p><p class=\"MsoNormal\" style=\"text-align:justify;\">&nbsp;</p><p class=\"MsoNormal\" style=\"text-align:justify;\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify;\"><span lang=\"EN-IN\">Since the transaction is service-based, we have implemented based on mutually agreed terms and conditions between Buyers(client) and Sellers(Freelancers), this is a policy keeping in mind the mostly occurring business scenario however any exceptional case</span><span style=\"mso-spacerun:yes;\" lang=\"EN-IN\">&nbsp; </span><span lang=\"EN-IN\">will be handled inline with laws and SkillMonde terms and conditions</span><span style=\"mso-spacerun:yes;\" lang=\"EN-IN\">&nbsp; </span><span lang=\"EN-IN\">.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;\">&nbsp;</p><p class=\"MsoNormal\" style=\"text-align:justify;\"><o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify;\"><span lang=\"EN-IN\">However, we are going to follow the below set of guidelines keeping in mind various factors as mentioned below:</span><o:p></o:p></p><p class=\"ql-align-justify\">&nbsp;</p><h4 class=\"ql-align-center\" style=\"text-align:center;\"><strong>BUYER/CLIENT CANCELS THE PROJECT</strong></h4><p class=\"ql-align-center\">&nbsp;</p><ol><li style=\"text-align:justify;\">As a first step, Buyer/Client has to approach Seller through our Chat feature on the website to discuss his/her intent to cancel the project citing the reasons. If Seller/Freelancer agrees for full or partial refund considering his time spent on the project from the time of confirmation till the time of cancellation, we will go by freelancers input on his consent of refund and cancellation of project and the amount.</li><li class=\"ql-align-justify\" style=\"text-align:justify;\">Seller does not accept cancellation of project, we will follow the below rules keeping in mind the interest of both the buyers and sellers:</li></ol><p class=\"ql-align-center\">&nbsp;</p><p class=\"MsoNormal\" style=\"margin-left:.25in;\">&nbsp;</p><figure class=\"table px-6 w-full text-center\"><table class=\"MsoNormalTable\" style=\"border-collapse:collapse;mso-padding-alt:0in 5.4pt 0in 5.4pt;mso-yfti-tbllook:1184;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"585\"><tbody><tr style=\"height:29.0pt;mso-yfti-firstrow:yes;mso-yfti-irow:0;\"><td style=\"border:1.0pt solid windowtext;height:29.0pt;mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt;vertical-align:top;width:50.3pt;\" width=\"67\"><p class=\"MsoNormal\" style=\"line-height:normal;margin-bottom:0in;\"><span style=\"color:black;\"><span style=\"mso-ascii-font-family:Calibri;mso-bidi-font-family:Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;mso-hansi-font-family:Calibri;\" lang=\"EN-IN\"><strong>Project duration</strong></span></span><o:p></o:p></p></td><td style=\"border-bottom:1.0pt solid windowtext;border-left-style:none;border-right:1.0pt solid black;border-top:1.0pt solid windowtext;height:29.0pt;mso-border-bottom-alt:solid windowtext .5pt;mso-border-right-alt:solid black .5pt;mso-border-top-alt:solid windowtext .5pt;padding:0in 5.4pt;vertical-align:top;width:388.15pt;\" colspan=\"5\" width=\"518\"><p class=\"MsoNormal\" style=\"line-height:normal;margin-bottom:0in;\"><span style=\"color:black;\"><span style=\"mso-ascii-font-family:Calibri;mso-bidi-font-family:Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;mso-hansi-font-family:Calibri;\" lang=\"EN-IN\"><strong>Project in Single Delivery Model</strong></span></span><o:p></o:p></p></td></tr><tr style=\"height:29.0pt;mso-yfti-irow:1;\"><td style=\"border-bottom-style:solid;border-color:windowtext;border-left-style:solid;border-right-style:solid;border-top-style:none;border-width:1.0pt;height:29.0pt;mso-border-bottom-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;mso-border-right-alt:solid windowtext .5pt;padding:0in 5.4pt;vertical-align:top;width:50.3pt;\" width=\"67\"><p class=\"MsoNormal\" style=\"line-height:normal;margin-bottom:0in;\"><span style=\"color:black;\"><span style=\"mso-ascii-font-family:Calibri;mso-bidi-font-family:Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;mso-hansi-font-family:Calibri;\" lang=\"EN-IN\">&nbsp;</span></span><o:p></o:p></p></td><td style=\"background-color:white;border-bottom:1.0pt solid windowtext;border-left-style:none;border-right:1.0pt solid windowtext;border-top-style:none;height:29.0pt;mso-border-bottom-alt:solid windowtext .5pt;mso-border-right-alt:solid windowtext .5pt;padding:0in 5.4pt;vertical-align:top;width:68.6pt;\" width=\"91\"><p class=\"MsoNormal\" style=\"line-height:normal;margin-bottom:0in;\"><span style=\"color:black;\"><span style=\"mso-ascii-font-family:Calibri;mso-bidi-font-family:Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;mso-hansi-font-family:Calibri;\" lang=\"EN-IN\"><strong>Cancellation Request Time</strong></span></span><o:p></o:p></p></td><td style=\"background-color:white;border-bottom:1.0pt solid windowtext;border-left-style:none;border-right:1.0pt solid windowtext;border-top-style:none;height:29.0pt;mso-border-bottom-alt:solid windowtext .5pt;mso-border-right-alt:solid windowtext .5pt;padding:0in 5.4pt;vertical-align:top;width:120.4pt;\" width=\"161\"><p class=\"MsoNormal\" style=\"line-height:normal;margin-bottom:0in;\"><span style=\"color:black;\"><span style=\"mso-ascii-font-family:Calibri;mso-bidi-font-family:Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;mso-hansi-font-family:Calibri;\" lang=\"EN