(8, '70E5E05136DBA92A3436', '293311', 153, 'Animation Localization Project', 'animation-localization-project', 'We have a requirement for localization of the animations in Hindi and Kannada which is being developed using the Animate, After Effects, and Vyond. \nTotal Volume: 50 Lessons, each lesson having 15 min of duration \nFreelancer or Vendor need to have Animate and After Effects. Vyond License will be provided by us\nPlease post bids with pricing per lesson as well as for the entire 50 lessons. Also, Share your weekly output\nCompletion Date: Sep 30, 2023', 3, 500, 750, NULL, 'per_chapter', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 210, 266, 0, NULL, NULL, NULL, '2023-07-19 06:18:24', '2023-12-07 04:15:02'),
(9, '05BBA64660484633B26B', '529830', 153, 'Animation Training Videos', 'animation-training-videos', 'we have a requirement to develop a series of training videos for internal employees, these videos will be uploaded in company\'s  Learning Platform.\n\nBelow are the requirements:\n\nCreate videos with animations [2-D explainer]  refer https://youtu.be/kotrBD1wkE0\nAdd the quizzes / check your understanding or mini-test in these contents\nThe videos will be recorded in English (subtitles in Japanese &amp; Cantonese) \nTopics will be IT Related  for e.g Emerging technology trends in Cybersecurity etc\nBudget :  3000/min - 6000/min', 3, 3000, 6000, NULL, 'per_minute', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 120, 163, 0, NULL, NULL, NULL, '2023-07-19 06:32:44', '2023-12-08 06:35:02'),
