(14, '83861B284D7ADDDD4227', '915470', 83, 'eLearning module development on Articulate', 'elearning-module-development-on-articulate', 'We have a requirement of developing elearning modules on Articulate. we will provide storyboards. THe output is roughly about 2 hour of content.', 8, 75000, 100000, NULL, 'hourly', 0, 'active', NULL, 1, 0, 0, 0, NULL, NULL, NULL, 90, 146, 0, NULL, NULL, NULL, '2023-08-23 06:14:49', '2023-12-07 15:30:01'),
