(16, 'C888DF493922D63353A7', '320587', 265, 'Book Cover Modification', 'book-cover-modification', 'We have a book cover that needs to be customized according to the client.\nThe book is customized for a school based out of US.\n\nModifications to be done:\n- To add a name of a school on front and back cover, inside cover and spine\n- ISBN bar code to be added on back cover', 16, 500, 1500, NULL, 'fixed', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 134, 188, 0, NULL, NULL, NULL, '2023-09-01 15:08:01', '2023-12-06 16:40:01'),
(17, '2B6C0FF065B39B25A355', '565535', 83, 'Project Management- eLearning', 'project-management-elearning', 'We need a project manager who can coordinate with all the stakeholders. The person should have a knowledge of eLearning workflows and basic technical details.\nWe will pay hourly basis based on the experience of a person.\nThe candidate will need to spend roughly about 2-4 hours on weekdays.\nTimezone- EST US time', 9, 500, 3000, NULL, 'hourly', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 48, 52, 0, NULL, NULL, NULL, '2023-09-06 12:04:37', '2023-12-07 03:00:01'),
(18, '4470C21FF36460432A62', '530608', 83, 'Instructional Designing- School', 'instructional-designing-school', 'We are looking for ID who can work on conceptualization, ideation, and work on creating storyboards for school course. We are developing content for K-12 school courses.\nThe person should have minimum of 3 years of experience in creating such storyboards for school courses.\nWe will pay hourly basis. The range may vary as per the experience of the candidate\nNeed about 5 of IDs.', 8, 1000, 5000, NULL, 'hourly', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 53, 54, 0, NULL, NULL, NULL, '2023-09-06 12:11:02', '2023-12-08 04:25:01'),
(19, '346EC847C0E528F4F245', '628892', 83, 'Freelance Project for Animators', 'freelance-project-for-animators', 'If you are an animator who can create animations for school courses, please do apply.\nThe candidate should know Vyond, After effects and Animate.\nCompensation may vary depending on the experience. And it will be paid by minutes, and depending on the tool and complexity.', 3, 500, 6000, NULL, 'per_minute', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 53, 55, 0, NULL, NULL, NULL, '2023-09-06 12:13:47', '2023-12-07 14:45:01'),
(20, 'E6FDAE4056EC05ECCFCE', '962441', 83, 'Freelance project Graphic Design', 'freelance-project-graphic-design', 'For the online courses, we will need help of graphic designers to create illustrations, characters and many other forms of visuals for courses.\nIf you know Adobe tools, please apply\nCompensation may vary depending on the skills, experience, and complexity of the work', 16, 500, 5000, NULL, 'hourly', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 112, 124, 0, NULL, NULL, NULL, '2023-09-06 12:18:41', '2023-12-07 03:40:01'),
(21, '436A40CD8378635BBB37', '513451', 265, 'Decoding Book Writing for Grade- K', 'decoding-book-writing-for-grade-k', '- decodable on following:\n\n3 kids in America with three story lines - focus on culture/family structure for each kid\n\nBen, Bob, Sal, Bev, Ted, Ned (as examples). Mix of boy and girl.\n\n- sight words that can be used:\nhe she we\nof I\nand is\nthe a\n\nneed 90% of the words to have decodability (to be decodable by the students)\n\nTemplate shall be shared\n\nNote- Budget is not finalized. We are going to evaluate few candidates and compare the bids accordingly and award. There are mutliple requirements for many books. We expect to work with 4-5 freelancers. Freelancers with prior experience on writing similar books for K-5 school kids for US schools, shall be given preference. \n\nWe suggest you to share your previous sample while bidding for this project.', 2, 500, 1000, NULL, 'per_page', 0, 'pending_final_review', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 211, 283, 0, NULL, 204, 17, '2023-09-08 17:32:37', '2023-12-07 05:20:02'),
(22, '0836C459CE13899BE3BA', '226273', 265, 'Background Knowledge (teacher reads this aloud in class) pages for 2nd graders:', 'background-knowledge-teacher-reads-this-aloud-in-class-pages-for-2nd-graders', '150 -175 words\nWritten at early 2nd grade reading level (teacher reads out loud)\ntopic: History of Black Cowboys in America \nFocus on\nRise of cowboys to herd cattle, including Black Cowboys \nDiscrimination faced by Black Cowboys\nStates where most Black Cowboys lived\nIdea that Black cowboys are still around today\n\nPlease submit your bid and previous samples.\nOur budget is not finalized and may vary at the time of finalization.', 2, 500, 1000, NULL, 'per_page', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 156, 232, 0, NULL, NULL, NULL, '2023-09-08 17:34:24', '2023-12-06 16:45:02'),
