(32, '0E69E0CAB9008CF52A88', '985816', 343, 'Quantum Physics Research Project', 'quantum-physics-research-project', 'Project Objective:\n\nResearch and summarize solutions from quantum physics that can address significant economic challenges and emerging trends. These trends include Climate Change, Energy, Skills Development, Education, Healthcare, Affordable Housing, Food and Water, Globalization, and more.\n\nTasks:\n\n1. Conduct thorough research using books, academic papers, science journals, and relevant theses to identify these quantum solutions.\n2. Compile and distill these solutions into a clear summary.\n3. After researching each trend, present and discuss your findings.\n\nSample Work (other resources- just for reference)\n\nhttps://papers.ssrn.com/sol3/papers.cfm?abstract_id=4440264\n\n\nPlease note: We\'re also delving into this topic, so collaboration is key. Share your discoveries regularly, focusing on each trend one by one.', 11, 100000, 300000, 0, 'fixed', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 48, 57, 0, NULL, NULL, NULL, '2023-10-09 13:20:51', '2023-12-06 21:55:02'),
(33, 'CC64B6D7DBDC430F9564', '458049', 153, 'Copy Editing for SkillMonde\'s Client', 'copy-editing-for-skillmondes-client', 'The Copy Editing project for the client involves improving the quality, clarity, and overall effectiveness of written content. This project\'s primary objective is to ensure that the client\'s written materials, such as documents, articles, reports, or marketing collateral, meet high editorial standards and effectively communicate their intended message.\nScope of Work:\n1. Document Review:\n	 Review the client\'s existing written materials, including documents, articles, reports, and other content requiring copy editing.\n2. Editorial Assessment:\n	 Assess the client\'s writing style, tone, and specific requirements to tailor the copy editing process accordingly.\n3. Grammar and Style Check:\n	 Correct grammatical errors, punctuation issues, and inconsistencies in writing style and tone.\n4. Spelling and Proofreading:\n	 Thoroughly proofread the content to eliminate spelling errors and typos.\n5. Clarity and Readability:\n	 Ensure that the content is clear, concise, and easily understandable to the target audience.\n6. Consistency:\n	 Maintain consistency in formatting, terminology, and language usage throughout the documents.\n7. Fact-Checking:\n	 Verify the accuracy of facts, figures, and data presented in the content.\n8. Rewriting and Revision:\n	 If necessary, rewrite or rephrase sentences and paragraphs to enhance clarity and impact.\n9. Cross-Referencing:\n	 Check and cross-reference citations, references, and footnotes for accuracy and completeness.\n10. Client Collaboration:\n	 Collaborate closely with the client to address specific editing needs and incorporate their feedback.\n11. Track Changes:\n	 Utilize track changes and comments to provide a clear and transparent record of edits and suggestions.\n12. Quality Assurance:\n	 Conduct multiple rounds of review and quality assurance to ensure the highest editorial standards are met.\n13. Delivery:\n	 Provide the edited content to the client in the preferred format, ensuring it is ready for publication or distribution.\n14. Final Approval:\n	 Seek final approval from the client to ensure they are satisfied with the edited content.\nThe Copy Editing project for the client is designed to elevate the quality of written materials, enhance their professional image, and effectively convey their intended message. It will be a collaborative effort between the copy editor and the client to ensure that the final content meets the highest editorial standards and fulfills their communication goals.', 4, 3000, 5000, NULL, 'per_word', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 23, 27, 0, NULL, NULL, NULL, '2023-11-17 17:16:40', '2023-12-08 11:30:02'),
(34, '4AFB0D0C227D405664E3', '705166', 153, 'Social Media Marketing Campaign', 'social-media-marketing-campaign', 'The Social Media Marketing Campaign for a SkillMonde\'s client is a strategic initiative aimed at enhancing the client\'s online presence and engaging with their target audience through various social media platforms. This project\'s primary goal is to create and execute a comprehensive social media marketing plan to increase brand visibility, drive website traffic, and ultimately achieve the client\'s marketing objectives.\nScope of Work:\n1. Social Media Audit:\n	 Conduct a thorough analysis of the client\'s current social media presence, including platforms, content, and engagement levels.\n2. Goal Setting:\n	 Define specific, measurable, and time-bound goals for the social media marketing campaign, aligning with the client\'s overall business objectives.\n3. Target Audience Research:\n	 Identify and profile the client\'s target audience to tailor content and messaging effectively.\n4. Content Strategy:\n	 Develop a content strategy that includes the creation of engaging and relevant content, such as posts, videos, images, and infographics.\n5. Content Calendar:\n	 Create a content calendar outlining the timing and frequency of social media posts and campaigns.\n6. Platform Selection:\n	 Choose the most suitable social media platforms for the client based on their industry, audience, and goals.\n7. Paid Advertising:\n	 Plan and execute paid advertising campaigns on relevant social media platforms to increase reach and engagement.\n8. Community Management:\n	 Monitor and engage with the client\'s social media community, responding to comments, messages, and feedback.\n9. Analytics and Reporting:\n	 Set up analytics tools to track key performance indicators (KPIs) and provide regular reports on the campaign\'s effectiveness.\n10. Influencer Marketing:\n	 Identify and collaborate with relevant social media influencers to expand the client\'s reach.\n11. Cross-Promotion:\n	 Implement strategies for cross-promotion with partners and industry peers to reach a wider audience.\n12. Crisis Management:\n	 Develop a crisis management plan to address any negative social media situations promptly.\n13. A/B Testing:\n	 Conduct A/B tests to optimize content and ad performance for better results.\n14. Budget Management:\n	 Manage the social media marketing budget efficiently, allocating resources to high-impact strategies.\n15. Training:\n	 Provide training to the client\'s team on social media best practices, content creation, and community management.\n16. Growth and Scaling:\n	 Identify opportunities for growth and scaling of the social media campaign as it progresses.\nThe Social Media Marketing Campaign for the client is designed to boost the client\'s online presence, engage their target audience, and drive business growth. It involves a collaborative effort between social media marketers, content creators, and data analysts to execute a successful campaign and achieve the desired marketing outcomes.', 10, 70000, 100000, 0, 'fixed', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 17, 18, 0, NULL, NULL, NULL, '2023-11-18 10:50:36', '2023-12-06 11:10:01'),
(35, 'DD13CB77BFD10E21FD09', '214262', 153, 'Website Blog Content Creation', 'website-blog-content-creation', 'We are seeking an experienced content writer to create engaging and informative blog articles for our website. The project aims to develop high-quality, SEO-optimized content to enhance our online presence and provide value to our target audience.\nScope of Work:\n Produce a series of blog articles on topics related to our industry (specific topics will be provided).\n Each article should be between 800 to 1,000 words in length.\n Conduct keyword research and incorporate relevant keywords into the content for SEO purposes.\n Ensure the content is well-researched, accurate, and free from grammatical and spelling errors.\n Maintain a consistent and engaging writing style that resonates with our audience.\nTarget Audience: Our target audience includes professionals and enthusiasts interested in our industry. The content should cater to a diverse group of readers, from beginners to experts.\nTone and Style: We require a conversational and informative writing style. The tone should be friendly, approachable, and expertly written.\nContent Schedule: We anticipate a steady output of two blog articles per week, and we prefer the content to be delivered in batches.\nPayment: Payment will be on a per-article basis. Please provide your fixed rate per article when submitting your bid.\nSubmission and Communication: All content should be submitted in a digital format (e.g., Google Docs or Microsoft Word). Communication will primarily occur via email.\nEvaluation and Selection: We will evaluate bids based on the quality of the proposal, relevant experience, and your writing samples. Please include samples of your previous work in your bid.\nSubmission Deadline: Bids should be submitted by 25 Nov 2023. We aim to start the project immediately, and the selected writer should be able to commence work shortly after the bid evaluation process.\nIf you are interested in this project, please submit your bid, including your rate per article and relevant writing samples. We look forward to working with a talented content writer who can help us enhance our online content and engage our audience effectively.', 2, 3000, 5000, 0, 'fixed', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 15, 15, 0, NULL, NULL, NULL, '2023-11-18 10:54:42', '2023-12-06 01:10:02'),
(36, 'CB9DC3416F0ECF24370E', '912286', 153, 'Animation Production', 'animation-production', 'The Animation Production project for SkillMonde\'s  is an artistic and technical endeavor focused on creating compelling and visually captivating animated content. This project aims to produce high-quality animations that align with the project\'s objectives, whether for entertainment, education, advertising, or any other purpose.\nScope of Work:\n1. Concept Development:\n	 Collaborate with the project stakeholders to brainstorm and refine the animation concept, storyline, and visual style.\n2. Scriptwriting:\n	 Develop a script that outlines the narrative, dialogues, and scene descriptions for the animation.\n3. Storyboard Creation:\n	 Create a detailed storyboard that serves as a visual blueprint for the animation, illustrating each scene\'s composition and progression.\n4. Character Design:\n	 Design and develop characters, including their appearance, personalities, and expressions, if applicable.\n5. Art Direction:\n	 Define the overall art direction, including the choice of colors, visual style, and aesthetics to create a cohesive look and feel.\n6. Animation Production:\n	 Animate the scenes and characters based on the approved script and storyboard, using various animation techniques and software.\n7. Sound and Music:\n	 Incorporate sound effects and music to enhance the animation\'s emotional impact and storytelling.\n8. Voiceovers (if applicable):\n	 If necessary, record and integrate voiceovers for characters or narration.\n9. Quality Control:\n	 Conduct multiple rounds of review and quality checks to ensure the animation meets artistic and technical standards.\n10. Editing and Post-Production:\n	 Edit the animation, fine-tuning timing, transitions, and visual effects to create a polished final product.\n11. Rendering:\n	 Render the animation into the desired format and resolution for distribution.\n12. Delivery:\n	 Provide the client or project stakeholders with the final animation files in the required format.\n13. Feedback and Revisions:\n	 Collaborate with the client to address feedback and make necessary revisions to the animation.\n14. Project Management:\n	 Manage project timelines, budgets, and resources to ensure the project stays on track.\n\nThe Animation Production project for the client is dedicated to creating visually captivating and emotionally engaging animated content. It involves a collaborative effort between animators, artists, writers, sound engineers, and project stakeholders to bring the project\'s vision to life.Please submit the bids before 30th Nov 2023', 3, 300000, 500000, 0, 'fixed', 0, 'active', NULL, 0, 0, 0, 0, NULL, NULL, NULL, 21, 21, 0, NULL, NULL, NULL, '2023-11-18 11:01:47', '2023-12-08 13:20:02');
