(1, 'dd2ae61b4846d22af791', 7, 139, '9000', 13, 'i can deliver the project as per requirements and timeline. I have experience in managing such projects in past.', 0, 0, 0, 1, 1, 'active', NULL, NULL, '2023-06-09 12:07:06', '2023-06-09 12:09:58', NULL, '2023-06-09 11:58:03', '2023-06-09 12:09:58'),
(2, 'eebdc4a9c4b7257177d4', 9, 109, '4000', 50, 'I can do it', 0, 1, 0, 0, 0, 'pending_payment', NULL, NULL, NULL, NULL, NULL, '2023-07-19 07:02:02', '2023-07-19 07:02:02'),
(3, '7baba9307004f0241adf', 8, 30, '700', 5, 'Sample', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-07-21 06:28:43', '2023-07-21 06:28:43'),
(5, 'f36128734e2864ff8150', 9, 167, '5000', 3, 'Hello There,\n\nI just proposed to complete a video within 3 working days, I need to know if the assets for animation will be provided to us or if we have to create from scratch. I use after effects for animation. please let me know your concern and looking forward to work with you.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-08-05 08:25:13', '2023-08-05 08:25:13'),
(7, '3de8a465fc69692ae124', 14, 208, '75000', 5, 'PHASE 1 - Course Theming and Structuring\n\n	Once the script and flowchart has been finalized, course theming and Articulate Storyline (SL) prototyping will commence then for review with client decision.\n     	Course Theming\n         	Setting the look and feel of the course\n         	Setting the right branding in alignment with clients\n     	SL Prototyping/Design Proof\n         	Setting the course flow chart structure in SL for prototyping purposes to be shown to the client for approval.\n     	Review &amp; Revise\n         	Client to review the output for approval \n\n\nPHASE 2 - Multimedia and Articulate Storyline Development\n\n	In this phase, development of multimedia contents will commence e.g. animation, voiceover, digital elements and interactivity. \n     	Tools for multimedia\n         	Adobe Creative Suites (Animate, After Effects, Photoshop, Illustrator)\n         	Camtasia or Active Presenter\n         	Adobe Audition\n     	Publishing/Authoring Tools \n         	Articulate Storyline 360\n         	Articulate Rise\n	Review &amp; Revise\n     	Review the output for approval (3 revision cycles)\n         	1st and 2nd - Internal Revision Cycle\n         	3rd - Client Revision Cycle\n\n\nPHASE 3 - Course versioning\n\n	This phase sets the course development version\n     	Course Prototype \n         	This is a version where course flowchart is applied in Articulate Storyline \n         	Placeholder of the contents are set in Storyline for the client to visualize\n     	Design Proof\n         	This version has the first layer content (Module 1) of the course\n	For example: \n     	Splash Page &gt; Introduction &gt; Module 1 &gt; Module 1 Quiz &gt; Result \n     	Alpha\n         	All course content is applied on this version. \n	For example: \n     	Splash Page &gt; Introduction &gt; All Modules &gt; All Quizzes &gt; Results &gt; Ending\n     	 Beta\n         	Once the alpha version is approved and finalized, Beta version will be set.\n     	Gold\n         	This will be the final version of the course to be handed over to the client.\n\n\nPHASE 4 - Internal and Client Review Cycle\n\n	Two phases of review:\n     	1st and 2nd Review Cycle\n         	Internal Revision Cycle\n     	3rd Review Cycle\n         	Client Revision Cycle', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-08-24 02:15:36', '2023-08-24 02:15:36'),
(8, '99d3494cfc34ebb3f440', 14, 204, '75000', 7, 'We will follow a process from script to design to implementation in articulate.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-08-24 06:55:23', '2023-09-08 18:30:05'),
(9, '25d01845bdd08af8ceff', 16, 139, '500', 1, 'we will do the required', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-04 04:17:05', '2023-09-04 04:17:05'),
(10, '22275b132e7c6548501e', 14, 228, '75000', 3, 'My primary goal for this project is to create an engaging and effective learning experience for the target audience. To achieve this, I will carefully considered several key elements: \n\nTo enhance the learning experience, we will incorporate interactive animations strategically throughout the course. These animations will not only make the content more visually appealing but also help in explaining complex concepts in an easy-to-understand manner. Learners will have the opportunity to engage with the material actively.\n\nI will integrate high-quality visual elements such as infographics, charts, images, and diagrams where appropriate. These aids will serve as powerful tools to reinforce key points and make the content more visually stimulating.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-06 06:41:08', '2023-09-06 06:41:08'),
(11, 'cd9d395e9f3a995b9439', 13, 2, '2000.00', 30, 'Accepted', 0, 0, 0, 1, 1, 'active', NULL, NULL, '2023-09-09 09:37:28', '2023-09-09 09:45:34', NULL, '2023-09-07 12:25:27', '2023-09-14 15:22:38'),
(12, 'e3b7d9455dbae8c36fc1', 13, 19, '1000', 7, 'test', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-07 12:29:06', '2023-09-09 12:48:24'),
(13, '2f18e72f6cbb7c815b6a', 17, 295, '3000', 7, 'I have 5 years of experience in elearning project management. I have worked with global clients and delivered best to universities on time without any delay in content. I am very clear on the process of elearning projects delivery. I believe I will be best fit for your requirement. Consider this as my humble request and provide me the opportunity to deliver the best for you.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-08 07:34:56', '2023-09-09 12:48:19'),
(14, '06a7341fdc5aef567eef', 14, 295, '95000', 7, 'I have good amount of experience in developing the similar content.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-08 07:40:27', '2023-09-09 12:47:31'),
(15, 'ac987bf6d61dbcbed98f', 22, 109, '1000', 5, 'I can do this with the required skills.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-09 10:42:06', '2023-09-27 18:30:05'),
(16, 'c3dca8dd9fb754d08b0d', 22, 204, '700', 5, 'We will be able to perform this project as required. WE will be happy to show our samples as well.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-09 10:53:55', '2023-09-09 12:47:23'),
(17, 'ff8b541720cde8443b0e', 21, 204, '500', 5, 'We have the skills required to complete this project. We have done the similar work earlier as well.', 0, 0, 0, 1, 1, 'active', NULL, NULL, '2023-09-25 10:57:06', '2023-09-25 11:04:08', NULL, '2023-09-09 10:56:16', '2023-09-25 11:04:08'),
(18, '3e1df37bd96374c571ae', 22, 2, '700', 7, 'I am excited to bid on your project about the history of Black Cowboys in America, tailored to an early 2nd-grade reading level. I have extensive experience in creating educational content that engages young learners.\n\nFor this project, I will craft a 150-175 word article that covers the rise of cowboys, including Black cowboys, their struggles with discrimination, the states where most of them lived, and the important fact that Black cowboys are still a part of cowboy history today. I will ensure that the content is informative and easy for young readers to understand, with a focus on engaging storytelling.\n\nPlease find a sample of my previous work attached to this bid. I understand that your budget is not finalized and may vary, so I am open to discussing pricing that aligns with your project\'s specific requirements and expectations.\n\nI look forward to the opportunity to contribute to your project and help young readers learn about this important part of American history. Thank you for considering my bid.', 0, 0, 0, 0, 0, 'active', NULL, NULL, NULL, NULL, NULL, '2023-09-09 12:30:58', '2023-09-09 12:47:06'),
